import React from "react";
import "./style.css";
const Todo = () => {
  return (
    <>
      <div className="main-div">
        <div className="child-div">
          <figure>
            <img
              src="./image/todo.svg "
              alt=" https://media.istockphoto.com/photos/creativity-inspiration-concepts-light-bulb-idea-with-2021-new-year-picture-id1257182595?k=20&m=1257182595&s=612x612&w=0&h=ywGnkS2bDhEl2K2CcOsoknY0M6LGG9bhDBHGIHsloQY="
            />
          </figure>
        </div>
      </div>
    </>
  );
};

export default Todo;
